DROP TABLE m_ayuda_sicei;

CREATE TABLE `m_ayuda_sicei` (
  `COD_OPCION` varchar(13) NOT NULL,
  `DETALLE` longtext NOT NULL,
  UNIQUE KEY `cod_opcion` (`COD_OPCION`)
) ENGINE=MyISAM DEFAULT CHARSET=latin1;

\nEn este módulo es donde el Analista CTS se encarga de manejar todas las solicitudes de los equipos de computación. \n\nEn primer lugar en este módulo encontramos la Apertura de Solicitud el cual está diseñado para que se registre la solicitud de los equipos informáticos.\n\n\n\n\nGestión de Solicitudes\nEn este módulo es donde el Analista CTS se encarga de manejar todas las solicitudes de los equipos de computación. \n\nEn primer lugar en este módulo encontramos la Apertura de Solicitud el cual está diseñado para que se registre la solicitud de los equipos informáticos.\n\n\n\n\nAl momento de recibir la solicitud el analista CTS registra la nueva solicitud presionando en primer lugar el botón Nuevo y procede a llenar todos los campos, es importante señalar que los campos como Tipo de Solicitud, Solicitante y Analista CTS cuenta con una ayuda de búsqueda en donde le permite seleccionar de manera dinámica la información contenida para esos campos.\n\n\nUna vez llenado todos los campos solicitados se procede a guardar los datos en la base de datos, si se desea consultar la información se debe posicionar el cursor en el campo Número de Solicitud y colocar el número y darle al botón Buscar y aparecerá toda la información referente a la solicitud.\n\nAl realizar el proceso de registro se cuenta con un botón de componentes que permite seleccionar los componentes de los equipos a registrar para la solicitud.\n\n\nSi se quiere filtrar la información por Número de Solicitud, Fecha, Código Analista CTS, Código Solicitante, Descripción se coloca la información precisa en la línea en blanco y se le da al botón Buscar y muestra la información puntual que el analista solicitó.\n\n\nEn este formulario existe un botón llamado Refrescar su función es para actualizar la pantalla y permite así ejecutar otra función bien sea agregar o consultar un registro. \n\n\nCabe destacar que todos los campos se encuentran validados y cuenta con una ayuda al usuario en cada campo para que pueda conocer que debe llenar.\n\nEn segundo lugar en este módulo encontramos Confirmar Solicitud el cual está diseñado para que se confirmar la solicitud de los equipos informáticos.\n\n\n\n\n\nEste formulario se procede a buscar el número de Solicitud se coloca el Número de la solicitud y se presiona enter o se le da al botón buscar y nos mostrará la información de las solicitudes registradas con sus respectivas descripciones, seriales y cantidades. Esta pantalla cuenta con 2 botones que interactúan con el cuadro de los componentes que permite Añadir o eliminar componentes de forma dinámica. Cabe destacar que para este formulario cada vez que se le da añadir significa que se está confirmando la solicitud con esos componentes de acuerdo a la necesidad de cada usuario.\n\n\nPor otra parte, en este formulario en la parte superior existe 3 botones Buscar, Limpiar e imprimir de los cuales el buscar ya se explicó anteriormente como funciona, luego vemos que si queremos iniciar una nueva búsqueda se presiona el botón limpiar y colocará en blanco todos los campos permitiendo así realizar la nueva búsqueda y el botón imprimir genera el formato de salida del Almacén.\n\n\nEn tercer lugar en este módulo encontramos Cancelar Solicitud el cual está diseñado para que se cancelar la solicitud de los equipos informáticos.\n\nEn este formulario se procede a buscar la solicitud para cancelarla, se coloca el Número de solicitud y se le da enter o se presiona el botón buscar y aparecerá la información almacenada en el formulario.\n\n\nEs necesario acotar que cuando se presiona el botón buscar permite realizar la búsqueda filtrada por Número de Solicitud, Fecha, Código Analista CTS, Código Solicitante, Descripción se coloca la información precisa en la línea en blanco y se le da al botón Buscar y muestra la información puntual que el analista solicitó.\n\n\nSe utiliza el botón guardar para cambiar el estatus de la solicitud si el analista decide Cancelar la solicitud debe seleccionar Anular y para que este proceso se lleve a cabo debe presionar el botón guardar.\n\n\nTenemos el botón limpiar que es el que coloca en blanco todos los campos permitiendo así realizar la nueva búsqueda y el botón refrescar que permite actualizar los campos en la base de datos.\n\nEn cuarto lugar en este módulo encontramos Cerrar Instalación el cual está diseñado para que se cancelar la solicitud de los equipos informáticos.\n\n\n\n\n\n\n\n\nEn este formulario se procede a buscar la solicitud para realizar el cierre de instalación, se coloca el Número de solicitud y se le da enter o se presiona el botón buscar y aparecerá la información almacenada en el formulario.\nEs necesario acotar que cuando se presiona el botón buscar permite realizar la búsqueda filtrada por Número de Solicitud, Fecha, Código Analista CTS, Código Solicitante, Descripción se coloca la información precisa en la línea en blanco y se le da al botón Buscar y muestra la información puntual que el analista .\n\n\nEste formulario se procede a buscar el número de Solicitud se coloca el Número de la solicitud y se presiona enter o se le da al botón buscar y nos mostrará la información del nombre de instalación, número de Configuración, usuario, componente y el número de serial. Esta pantalla cuenta con 2 botones que interactúan con el cuadro de los componentes que permite Añadir o eliminar componentes de forma dinámica. \n\n\nPor otro lado, el botón limpiar es el que coloca en blanco todos los campos permitiendo así realizar la nueva búsqueda, tenemos también el botón Cerrar que una vez verificado la asignación para realizar la instalación se procede a presionar el botón cerrar y queda cerrada la instalación.\n\n\nEn quinto lugar en este módulo encontramos Desincorporación y/o Devolución el cual está diseñado para desincorporar o devolver los equipos informáticos al almacén.\n\n\n\n\n\nEn este formulario se procede a buscar la solicitud para realizar las entradas por Desincorporación y/o Devolución, se coloca el Número de solicitud y se le da enter o se presiona el botón buscar y aparecerá la información almacenada en el formulario.\n\n\nEs necesario acotar que cuando se presiona el botón buscar permite realizar la búsqueda filtrada por Número de Solicitud, Fecha, Código Analista CTS, Código Solicitante, Descripción se coloca la información precisa en la línea en blanco y se le da al botón Buscar y muestra la información puntual que el analista solicitó.\n\n\nEste formulario se procede a buscar el número de Solicitud se coloca el Número de la solicitud y se presiona enter o se le da al botón buscar y nos mostrará la información del componente, descripción, nro. Serial y cantidad. Esta pantalla cuenta con 2 botones que interactúan con el cuadro de los componentes que permite Añadir o eliminar componentes de forma dinámica. \n\n\nPor otro lado, el botón limpiar es el que coloca en blanco todos los campos permitiendo así realizar la nueva búsqueda, tenemos también el botón guardar que nos permite a través del estatus desincorporar o devolver los equipos almacén o desincorporarlos del inventario.\n\n\nEn este formulario se cuenta con botones de ayuda para el buscar de forma rápida el almacén y buscar los componentes informáticos.\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n");



